<template>
  <div class="search-result-wrapper">
  <!-- filter section -->
  <div class="search-filter"
    :class="{show : showMwebFilteredModule}">
    <div @click="clearAllFilter" class="clear-filters">
      Clear All Filter
    </div>
    <div class="item">
      <p class="title">SEARCH FOR CARGROUP:</p>
      <input type="text"
        name="search-car"
        placeholder="Search for car..."
        v-model="searchCarGroup">
    </div>

    <div class="item">
      <div class="car-filter">
        <p class="title">CAR GROUP:</p>
        <div class="cargroup">

          <div class="type"
            :class="{active : type === 'hatchback'}"
            @click="type = 'hatchback'">
            <svg class="icon">
              <use xlink:href="#hatchback" />
            </svg>
            <div class="name">
              HatchBack
            </div>
          </div>

          <div class="type"
            :class="{active : type === 'sedan'}"
            @click="type = 'sedan'">
            <svg class="icon">
              <use xlink:href="#car" />
            </svg>
            <div class="name">
              Sedan
            </div>
          </div>

          <div class="type"
            :class="{active : type === 'mini suv'}"
            @click="type = 'mini suv'">
            <svg class="icon">
              <use xlink:href="#jeep" />
            </svg>
            <div class="name">
              Mini SUV
            </div>
          </div>

          <div class="type"
            :class="{active : type === 'suv'}"
            @click="type = 'suv'">
            <svg class="icon">
              <use xlink:href="#hatchback" />
            </svg>
            <div class="name">
              SUV
            </div>
          </div>
        </div>
      </div>
    </div>

    <div class="item">
      <div class="transmission-wrapper">
        <p class="title">TRANSMISSION:</p>
        <div class="transmission-types">
          <div class="transmission"
            :class="{active : transmission === 'automatic'}"
            @click="transmission='automatic'">
            <svg class="icon">
              <use xlink:href="#automatic-transmission" />
            </svg>
            <div class="name">
              Automatic
            </div>
          </div>

          <div class="transmission"
            :class="{active : transmission === 'manual'}"
            @click="transmission='manual'">
            <svg class="icon">
              <use xlink:href="#manual-transmission" />
            </svg>
            <div class="name">
              Manual
            </div>
          </div>
        </div>
      </div>
    </div>

    <div class="item">
      <div class="transmission-wrapper">
        <p class="title">FUEL:</p>
        <div class="transmission-types">
          <div class="transmission"
            :class="{active : fuelType === 'petrol'}"
            @click="fuelType = 'petrol'">
            <svg class="icon">
              <use xlink:href="#fuel-station" />
            </svg>
            <div class="name">
              Petrol
            </div>
          </div>

          <div class="transmission"
            :class="{active : fuelType === 'diesel'}"
            @click="fuelType = 'diesel'">
            <svg class="icon">
              <use xlink:href="#oil-tank" />
            </svg>
            <div class="name">
              Diesel
            </div>
          </div>
        </div>
      </div>
    </div>
    <button class="done"
      :class="{show : showMwebFilteredModule}"
      @click="closeMwebFilteredModule">
      DONE
    </button>
  </div>

  <!-- search result section -->
  <div class="search-result"
    :class="{hide : !showMwebResultModule}">

    <div class="modify-wrapper">
      <p class="title">MODIFY SEARCH: </p>
      <SearchWidget v-if="startDate" :seleted-date="startDate" :selected-location="location" />
      <div class="sort-wrapper">
        <label>SORT BY:</label>
        <div class="item"
          :class = "{active : order === 'descending'}"
          @click="order = 'descending'">
          Price: High to Low
        </div>

        <div class="item"
          :class = "{active : order === 'ascending'}"
          @click="order = 'ascending'">
          Price: Low to High
        </div>
      </div>

    </div>

    <div class="car-wrapper">
      <div class="car-details" v-for="car in result">
        <img :src="car.photo">
        <div class="details">
          <p class="name">{{car.name}}</p>
          <div class="features">
            <div class="feature">
              <i class="material-icons">event_seat</i>
              {{car.seats}} Seater
            </div>
            <div class="feature">
              <i class="material-icons">local_gas_station</i>
              {{car.fuel_Type}} type
            </div>
            <div class="feature">
              <i class="material-icons">directions_car</i>
              {{car.transmission}}
            </div>
          </div>
          <!-- <hr /> -->
          <div class="location">
            <i class="material-icons location-on">location_on</i>
            {{car.location}}
          </div>
        </div>
        <div class="booking-flow">
          <p class="price">â‚¹ {{car.price}}</p>
          <button>Book Now</button>
        </div>
      </div>
    </div>

    <div class="pagination">
      <div class="page"
        v-for="page in pages"
        :class="{active: pageNumber === page-1}"
        @click="pageNumber = page-1">
        {{page}}
      </div>
    </div>
  </div>
  <div class="mweb-filter"
    :class="{hide : !showMwebResultModule}"
    @click="showFilteredModule()">
